window.bookSummaryJSON = "<p>In this heart-stopping installment in the New York Times best-selling Immortals After Dark series, a vampire swordswoman and a ruthless sorcerer become inmates in a hellplane prison.</p> <p>A FALLEN PRINCESS: Sheltered Kosmina Daciano has always yearned for adventure. But her first trip to the mortal world turns dark when a foe curses her with bloodlust—ensuring her exile in the sinister dimension of Nightside.</p> <p>AN OUTLAW SORCERER: For millennia, Silt Harea has flouted the laws of the Lore with all the arrogance of a king, remaining one step ahead of ruination. Yet then a mysterious bounty hunter schemes to capture him, dispatching him straight to hell.</p> <p>FIGHT TO ESCAPE A DYING REALM: In Nightside, Silt clashes with the hunter’s sister, also condemned. Never imagining that she might be the key to his escape—and his future—he vows revenge against her. But Mina is no easy quarry.</p> <p>Can two doomed immortals survive long enough to salvage a nightmare, turning hatred into love and vengeance into bliss?</p>"; 
